/** 
 * countPixel
 *
 * Funktion zum Auslsen eines Zaehlpixel-Aufrufs
 * Die Funktion greift auf die bereitgestellte URL im Javascript der Seite zu und haengt dort die uebergebene
 * Information mit an (bspw. Bild-URL). Weiterhin werden vorsorglich per POST Daten mitgeschickt sofern diese
 * verwertbar und nicht sensibel sind (z.B. einfache Formulardaten aus Votings).
 * 
 */
function countPixel(data) {	
    if(data == undefined) { data = "jsContent"; } 

    /* szmng */
    getivw();

    /* Comscore */
    $('.cp').remove();

	if(typeof ZPIX != 'undefined') { 
		sitestatURL = ZPIX + data + '&amp;d='+(Math.random()*100000);  
		$("body").append("<img src='" + sitestatURL + "' alt='' width='1' height='1' class='cp' />");
	}
}

function getivw() {
      var ak_stat = "ndr";
      var ak_mobi = "mobndrde";
      function isStringDetected(value) {
         var regexp = new RegExp(value, "gi");
         return (regexp.test(navigator.appVersion) || regexp.test (navigator.userAgent)) ? true : false;
      }
      function isTablet() {
         if(isStringDetected("iPad") || (isStringDetected("Android") && !isStringDetected("Mobile"))) {
            return true;
         }
         return false;
      }
  /* SZMnG-Tag Responsiv-Weiche */
      $.ajaxSetup({ cache: true });
      $.getScript("https://script.ioam.de/iam.js").done(function() {
         var isMobil = typeof orientation!='undefined' ? true:false;
         if(isTablet()) { isMobil = false; } // Tabletts sind stationaer
         if(!isMobil) {
            var iam_data = {
                "st" : ak_stat,
                "cp" : "ndrstat"
            };
         } else {
             var iam_data = {
                "st" : ak_mobi,
                "cp" : "ndrmobi"
             };
         }
         iom.c(iam_data,1);
      });
}

jQuery.cachedScript = function( url, options ) {
	var scriptName = url.replace(/.*\//,"");
	if(urlparams()[scriptName]) { 
		url = url.replace(scriptName, urlparams()[scriptName]) 
	}

	  options = $.extend( options || {}, {  dataType: "script", cache: true, url: url });
	  return jQuery.ajax( options );
	};